import Link from 'next/link';

const linkStyle = {
	marginRight: 50,
	fontSize: '2em'
};

const linksStyle = {
	height: '2em',
	textAlign: 'center',
	left: '-100px',
	right: '-100px'
}

const Header = () => (
  <div style={linksStyle}>
    <Link href="/">
      <a style={linkStyle}>Recipes</a>
    </Link>
    <Link href="/shopping-list">
      <a style={linkStyle}>Shopping List</a>
    </Link>
  </div>
);

export default Header;
